      <a 
        href="https://teams.microsoft.com/l/message/19:1be4a702-9bfd-497e-861a-2d6194d66861_53ac61f3-a688-4792-9ac3-1a65944cd47e@unq.gbl.spaces/1766576099896?context=%7B%22contextType%22%3A%22chat%22%7D"
        target="_blank"
        rel="noopener noreferrer"
        className="teams-link-button"
      >
        Join on Microsoft Teams
